@Component({
  selector: 'app-date-info',
  templateUrl: './date-info.component.html',
  styleUrls: ['./date-info.component.css']
})
export class DateInfoComponent implements OnInit {
  public especialidad: any;
  public nombre: any;
  public puntuacion: any;
  public universidad: any;
  public tiempoServicio: any;
  public alergia: any;
  public medicamento: any;
  public finalizada: any;
  public id: string;

  public consultaActual: any;
  public sintomas: any;
  doctorInfoArray: any[] = [];
  doctorInfo: any;
  public usuario:any;
  public recomendaciones: any;
  public receta: any;
  @ViewChild("consulta") consulta:ElementRef;
  constructor(
    private http: HttpClient,
    private ConsultaService: ConsultaService
    ) {

    // location.reload();
  }

  ngOnInit(): void {
    this.consultaActual = JSON.parse(localStorage.getItem("consultaActual")).date;
    this.usuario = JSON.parse(localStorage.getItem("usuarioActualClinica")).user;
    // console.log(this.consultaActual);

    this.finalizada = this.consultaActual.time;
    this.especialidad = this.consultaActual.especialidad;
    this.medicamento = this.consultaActual.medicamento;
    this.alergia = this.consultaActual.alergia;
    this.sintomas = this.consultaActual.sintomas;
    
    if(this.especialidad == "Oftalmologia"){
      this.recomendaciones = ["Descanso prolongado", "No usar celular","No ver television o usar la computadora","No leer libros ni forzar uso de los ojos"];
      this.receta = ["10 pastillas de paracetamol, 1 cada 12 horas","Lagrimas artificiales, 3 cada 8 horas"];
    }else if(this.especialidad == "Dermatologia"){
      this.recomendaciones = ["Descanso prolongado", "Evitar rascarse","Evitar contacto al sol","Manterner hidratada la zona si hay picason"];
      this.receta = ["10 pastillas de isotretinoina, 1 cada 12 horas","Pomada hidratante, aplicar cada 8 horas"];

    }
  }
  generarPDF(){
    var doc = new jsPDF();
    
    var image = "data:image/png;base64,";

    var firma = "data:image/png;base64,"
    doc.addImage(image, 'PNG', 15, 10, 80, 20);
    doc.text("Receta medica e Informacion de la consulta", 40, 45);
    doc.text("Datos personales:", 20,55);
    doc.text("Nombre del paciente: " + this.usuario.name, 30,65);
    doc.text("Correo del paciente: " + this.usuario.email,30,75);
    doc.text("DNI del paciente: " + this.usuario.dni, 30, 85);

    doc.text("Sintomas del paciente: ", 20,105);
    doc.text(this.consultaActual.sintomas, 30, 115);
  
    doc.text("Datos de la receta: ", 20, 145);
    doc.text(this.receta, 30, 155);

    doc.text("Recomendaciones del medico:" ,20, 185);
    doc.text(this.recomendaciones,30,195);
    doc.addImage(firma, 'PNG',20, 250, 40,20);
    doc.text(`Doctor Castillo Guerrero Jorge\n especialista en ${this.especialidad}`, 90, 260);
    doc.save("receta.pdf");
  }  

  faUserAlt = faUserAlt;
  faArrowLeft = faArrowLeft;
}
